		["Swing Timer"] = {
			["sparkWidth"] = 10,
			["iconSource"] = -1,
			["wagoID"] = "jEBcD-xSW",
			["authorOptions"] = {
				{
					["type"] = "toggle",
					["default"] = false,
					["width"] = 1,
					["name"] = "Off Hand",
					["useDesc"] = true,
